export const mockMinuteHistoData: HistoData[] = mockMinuteData.map( rawData => ({
    ...rawData,
    time: new Date(rawData.time * 1000)   
}));

export const xScaleMinute= scaleBand<Date>()
                .range([ 0, mockDimensions.boundedWidth])
                .domain(mockMinuteHistoData.map( d => d.time))
                .round(true);
export const yScaleMinute = scaleLinear<number,number>()
                .range([ mockDimensions.boundedHeight, 0 ])
                .domain([Math.min(...mockMinuteHistoData.map( d => d.low)), Math.max(...mockMinuteHistoData.map( d => d.high))]);
const mockMinuteVolume = mockMinuteHistoData.map( d => d.volumefrom);
export const volumeMinute = scaleLinear<number,number>()
.domain([Math.min(...mockMinuteVolume),Math.max(...mockMinuteVolume)])
.range( [mockDimensions.marginBottom -40,0]);
